import React from 'react';
import styled from "styled-components"
import SearchBar from '../components/SearchBar';
const Container = styled.div`
  height:100%;
  overflow-y:scroll;
  backgroung:${({theme})=>theme.bg};
  padding:30px 30px;
  padding-bottom:50px;
  display:flex;
  flex-direction:column;
  align-items:center;
  gap:20px;
  @media (max-width:768px){
  padding: 6px 10px;};

  `
  const Headline = styled.div`
    font-size:34px;
    font-weight:500;
    color:${({theme})=> theme.text_primary};
    display:flex;
    align-items: center;
    flex-direction: column;
    @media(max-width:768px){
    font-size:22px;}`;
  const Span = styled.div`
    font-size:30px;
    font-weight:500;
    color:${({theme})=> theme.button};
    @media(max-width:768px){
    font-size:20px}`

    

const Home = () => {
  return (
    <Container>
      <Headline>
        Explore popular posts in the Comunity!
        <Span>☉ Generated with AI ☉</Span>
      </Headline>
      <SearchBar/>
      <Wrapper>

      </Wrapper>
    </Container>
  )
}

export default Home
